import React from "react";
import "./App.css";

function App() {
  return (
    <div>
      <h1>My Ugly Little To Do List</h1>
      <p>
        If you don't love yourself, how in the hell are you going to love
        somebody else?
      </p>
      <ul>
        <li>Thing1</li>
        <li>Thing2</li>
        <li>Thing3</li>
      </ul>
      <p>Can I get an Amen?</p>
    </div>
  );
}

export default App;
